<script>
	$(document).ready(function() {
		var anim = $("*[data-anim]")
		anim.each(function(i,e) {
			$(e).data("anim", $(e).data("anim").split(','))
		})

		anim.each(function(i, el) {

			var c = 0

			setInterval(function() {
				if (c >= 3) {
					c = 0
				} else {
					c++
				}

				am = $(el).data("anim")[c]

				$(el).css({
					// 'transform': 				'scale(' + $(el).data("anim")[c] + ')',
					'transform': 				'scale3d(' + am + ', ' + am + ', -1)',
					'transform-origin': 'center',
					'transition': 			'all .7s',
				})
			}, 700)
		})
	})
</script>
